import{_ as o,o as r,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const k=JSON.parse(`{"title":"§ 8.01-393 When book or paper or equivalent in clerk's office lost, destroyed, or illegible to be again recorded.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-393.md","filePath":"vacode/8.01-393.md"}`),i={name:"vacode/8.01-393.md"},s=e("h1",{id:"§-8-01-393-when-book-or-paper-or-equivalent-in-clerk-s-office-lost-destroyed-or-illegible-to-be-again-recorded",tabindex:"-1"},[t("§ 8.01-393 When book or paper or equivalent in clerk's office lost, destroyed, or illegible to be again recorded. "),e("a",{class:"header-anchor",href:"#§-8-01-393-when-book-or-paper-or-equivalent-in-clerk-s-office-lost-destroyed-or-illegible-to-be-again-recorded","aria-label":`Permalink to "§ 8.01-393 When book or paper or equivalent in clerk's office lost, destroyed, or illegible to be again recorded."`},"​")],-1),n=e("p",null,"When any such book, or any book, microfilm record, or record in other form containing the record of wills, deeds, or other papers, or any other paper filed in a clerk's office, is lost, destroyed, or is illegible, the clerk in whose office such book or paper was, upon the production to him of any original paper which was recorded in such book, or of an attested copy of the record thereof, or of anything else in such book, or of any paper so filed, shall, on application, record the same anew. The record shall show whether it is made from an original or a copy, and how the paper from which it was made was authenticated or attested. Such record shall have, as far as may be, the same effect that the record or paper for which it is substituted would have had.",-1),c=e("p",null,"Code 1950, § 8-281; 1977, c. 617.",-1),d=[s,n,c];function l(h,p,f,b,u,m){return r(),a("div",null,d)}const g=o(i,[["render",l]]);export{k as __pageData,g as default};
